sourcesContent:
import Kiva from '../../images/kiva.svg';
import UNDP from '../../images/undp.svg';
import MakeAWish from '../../images/makeawish.svg';
import GlobalTassels from '../../images/globaltassels.svg';

const partners = [
    {
        "name": "KIVA",
        "missionStatement": "We envision a financially inclusive world where all people hold the power to improve their lives.",
        "pic": {Kiva}
    },
    {
        "name": "United Nations Devlopment Programme",
        "missionStatement": 'UNDP works in about 170 countries and territories, helping to achieve the eradication of poverty, and the reduction of inequalities and exclusion. We help countries to develop policies, leadership skills, partnering abilities, institutional capabilities "and build resilience in order to sustain development results.',
        "pic": {UNDP}
    },
    {
        "name": 'Make-A-Wish America',
        "missionStatement": 'Together, we create life-changing wishes for children with critical illnesses.',
        "pic": {MakeAWish}
    },
    {
        'name': 'Global Tassels',
        'missionStatement': 'We open doors to colleges and universities worldwide and we are committed to empowering our students to be leaders in their fields; engaging them in their communities; supporting their living sustainability, and shaping them to become the voices and forces of change for their countries.',
    }
];

export default partners;
